        a: "arcRel",
        C: "curvetoCubicAbs",
        c: "curvetoCubicRel",
        H: "linetoHorizontalAbs",
        h: "linetoHorizontalRel",
        L: "linetoAbs",
        l: "linetoRel",
        M: "movetoAbs",
        m: "movetoRel",
        Q: "curvetoQuadraticAbs",
        q: "curvetoQuadraticRel",
        S: "curvetoCubicSmoothAbs",
        s: "curvetoCubicSmoothRel",
        T: "curvetoQuadraticSmoothAbs",
        t: "curvetoQuadraticSmoothRel",
        V: "linetoVerticalAbs",
